const { v4: uuidv4 } = require("uuid");

//src2 - task2
let items = [
  {
    id: uuidv4(),
    name: "ABC",
    level: 0,
  },
  {
    id: uuidv4(),
    name: "DEF",
    level: 1,
  },
  {
    id: uuidv4(),
    name: "GHJ",
    level: 2,
  },
  {
    id: uuidv4(),
    name: "NKL",
    level: 3,
  },
];

export default items;
